CSQueue getByFullName(String fullName) {
  if (fullName == null) {
    return null;
  }

  try {
    modificationLock.readLock().lock();
    return fullNameQueues.getOrDefault(fullName, null);
  } finally {
    modificationLock.readLock().unlock();
  }
}
